Rudy A Cesena, was a physicist on [[Project Orion (nuclear propulsion)|Project Orion]].

He was born in 1933. Graduated from Hoover Senior High Class of 1951. He went to [[San Diego State University]] Class of 1961. 

==Career==
Worked at Naval Electronics Lab, 1951 to 1959. General Atomic, 1959 to 1972. He later worked on a paper \Effects of space radiation on lasers\" with D.M.J Compton.

