'''Brajendra Kishore Roy Chowdhury''' (1874 AD - 1957 AD;<ref>http://en.banglapedia.org/index.php?title=Raychowdhuri,_Acharya_Brajendra_Kishore</ref>  Bengali Year: 1281-1364 <ref>(1281-1364 Bengali Year http://www.thedailystar.net/gouripur-house-needs-urgent-attention-35277)</ref>) was a patron of Indian classical music and national education of the Indian national movement.

==Background==
He was the [[zamindar]] of [[Gouripur, Bangladesh|Gouripur]] in [[Mymensingh district|Mymensingh]], Bengal. His son was Pandit Birendra Kishore Roy Chaudhuri, the eminent sitar player, a founder of the music department of [[Rabindra Bharati University]], [[Calcutta]] and author of ''Indian Music and Mia Tansen''.{{citation needed|date=March 2018}}

==Work==
He was one of the principal patrons of the [[National Council of Education]] that later became [[Jadavpur University]], [[Calcutta]]. He was a member of the Floud Commission in 1939.{{citation needed|date=March 2018}}

==Writings==
* Marxism and the Indian Ideal (1941)

==See also==
* [[Dawn (Bengali educational society)]]
* [[National Council of Education]]
* [[Jadavpur University]]

