{{short description|Bacteriophage which affects Wolbachia}}
{{Orphan|date=June 2019}}

{{Taxobox
| color_as           = Virus
| name               = WO virus
| virus_group        = 
| ordo               = 
| familia            = 
| genus              = 
| species            = WO virus
}}

'''WO virus''' is [[bacteriophage]] virus affecting bacteria of the genus ''[[Wolbachia]]'', hence its name. This virus is notable for carrying [[DNA]] related to the [[black widow spider|black widow]] [[Latrotoxin|spider toxin]] gene, becoming an example of a bacteriophage with animal-like DNA, implying [[DNA transfer]]s between [[eukaryote]]s and bacteriophages.<ref name=\BordensteinBordenstein2016\">{{cite journal|last1=Bordenstein|first1=Sarah R.|last2=Bordenstein|first2=Seth R.|title=Eukaryotic association module in phage WO genomes from Wolbachia|journal=Nature Communications|volume=7|year=2016|pages=13155 |pmid=27727237 |pmc=5062602 |doi=10.1038/ncomms13155|bibcode=2016NatCo...713155B}}</ref><ref name=\"Vanderbilt University\">{{cite web|last1=Salisbury|first1=David|title=Virus carrying DNA of black widow spider toxin discovered|url=https://news.vanderbilt.edu/2016/10/11/virus-carrying-dna-of-black-widow-spider-toxin-discovered/ |publisher=Vanderbilt University|accessdate=24 December 2016}}</ref>

'''Jim M. Bowler''' is an Australian geologist known for discovering the [[Lake Mungo remains]], which are considered the oldest human remains in Australia.<ref>McGregor, Lisa (14 Feb 2018). [https://www.abc.net.au/news/2018-02-12/mungo-man-what-to-do-next-with-australias-oldest-remains/9371038 “Mungo Man: What to do next with Australia's oldest human remains?“] ''ABC News''. Retrieved 12 April 2020.</ref> He is a professorial fellow at the [[University of Melbourne]], School of Earth Sciences.

Bowler made his discovery in western New South Wales while working for the department of biogeography and geomorphology at the [[Australian National University]].  The human remains he found, and their subsequent radiocarbon dating, contributed to the historical rewriting of the timeline for Aboriginal settlement.<ref> Foster, S. G., & Varghese, M. M. (2009). ''[https://www.jstor.org/stable/j.ctt24hdt9 The Making of The Australian National University: 1946-1996]''. ANU Press. pp. 241-242.</ref> The human remains Bowler found near Lake Mungo date to approximately 40,000 years ago.

==References==
{{reflist}}

==External links==
*[https://findanexpert.unimelb.edu.au/profile/12941-james-bowler University of Melbourne]

