'''Sajjan Singh Sindarli''' was an Indian politician who was a member of the [[Rajasthan Legislative Assembly]] elected from [[Sumerpur (Rajasthan Assembly constituency)]] 1972 to 1977 in [[Pali district]] in [[Rajasthan]] state. He was elected to assembly in 1972 from Sumerpur constituency.<ref>[[:hi:सुमेरपुर विधानसभा क्षेत्र (राजस्थान)]]</ref> He was elected on ticket of the [[Bharatiya Janata Party]].<ref>[[Sumerpur (Rajasthan Assembly constituency)]]</ref> He was also elected as jilla pramukh from [[Pali, Rajasthan|Pali]] on 1 March 1965 to 31 August 1977.<ref>http://www.bhaskar.com/news/RAJ-OTH-MAT-latest-sojat-news-054011-1312408-NOR.html</ref><ref>[[:hi:सज्जन सिंह्]]</ref>

==Family==
Sajjan singh born in Sindarli a mertiya rathore family.his father name was thakur madho singh mertiya before his thikana/jagir transfer to deoli village by jodhpur darbar.<ref>[[Sindarli]]</ref>

